import { Fragment } from "react";
import styles from "./app.modules.css";

function HomePage() {
  return (
    <Fragment>
      <h1>All Cops Are Bastards.</h1>
      <div className={styles.mainBox}></div>
    </Fragment>
  );
}

export default HomePage;
